import { useState } from 'react';
import { Link as RouterLink } from 'react-router-dom';
import PropTypes from 'prop-types';
import {
  AppBar,
  Badge,
  Box,
  Hidden,
  IconButton,
  Toolbar,
  Container,
} from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';
import AccountCircleIcon from '@material-ui/icons/AccountCircle';
import NotificationsIcon from '@material-ui/icons/NotificationsOutlined';
import InputIcon from '@material-ui/icons/Input';
import Logo from './Logo';

// Menu

import React from 'react';
import { withStyles } from '@material-ui/styles';
import Button from '@material-ui/core/Button';
import Menu, { MenuProps } from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import ListItemText from '@material-ui/core/ListItemText';


import { makeStyles } from '@material-ui/styles';

import {useSelector} from 'react-redux'

import KeyboardArrowDownIcon from '@material-ui/icons/KeyboardArrowDown';

import Avatar from '@material-ui/core/Avatar';



const useStyles = makeStyles({
  btnMain: {
    display: 'flex',
    justifyContent: 'space-between',
    marginTop: '5px',
    marginBottom: '5px',
    marginRight: '5px'
  },


});


const StyledMenu = withStyles({
  paper: {
    border: '1px solid #d3d4d5',
    minWidth: '300px'
  },
})((props) => (
  <Menu
    elevation={0}
    getContentAnchorEl={null}
    anchorOrigin={{
      vertical: 'bottom',
      horizontal: 'center',
    }}
    transformOrigin={{
      vertical: 'top',
      horizontal: 'center',
    }}
    {...props}
  />
));

const StyledMenuItem = withStyles((theme) => ({
  root: {
    display: 'flex',
    justifyContent: 'center',
    textAlign: 'center',
    marginTop: '-5px'
  },
}))(MenuItem);





const DashboardNavbar = ({ onMobileNavOpen, ...rest }) => {

  const state = useSelector(state => state);
  console.log(state.profile.userName)


  const classes = useStyles();
  // 
  const [anchorEl, setAnchorEl] = React.useState();

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };
  // 
  const [notifications] = useState([]);

  return (
    <AppBar
      elevation={0}
      {...rest}
    >
      <Toolbar>
        <RouterLink to="/">
          <Logo />
        </RouterLink>
        <Box sx={{ flexGrow: 1 }} />
        <Hidden xlDown>
          <IconButton color="inherit" size="large">
            <Badge
              badgeContent={notifications.length}
              color="primary"
              variant="dot"
            >
              <NotificationsIcon />
            </Badge>
          </IconButton>
          <IconButton color="inherit" size="large">
            <InputIcon />
          </IconButton>
        </Hidden>
        <Hidden lgUp>
          <IconButton color="inherit" onClick={onMobileNavOpen} size="large">
            <MenuIcon />
          </IconButton>
        </Hidden>
        <Button color="inherit" size="large"
          aria-controls="customized-menu"
          aria-haspopup="true"
          variant="contained"
          color="primary"
          onClick={handleClick}
        >
          <AccountCircleIcon />
        </Button>
        <StyledMenu
          id="customized-menu"
          anchorEl={anchorEl}
          keepMounted
          open={Boolean(anchorEl)}
          onClose={handleClose}
        >
          <KeyboardArrowDownIcon style={{position: "absolute", left: '260px'}} />
          <StyledMenuItem>
          <Avatar alt="Remy Sharp" src="/static/images/avatars/avatar_6.png" style={{fontS}} />
          </StyledMenuItem>

          <RouterLink to="account">
            <StyledMenuItem>
              <ListItemText primary={state.profile.userName} />
            </StyledMenuItem>
          </RouterLink>

          <StyledMenuItem>
            <p>{state.profile.post}</p>
          </StyledMenuItem>

          <Container className={classes.btnMain} >
            <Button variant="contained" color="primary">
              Change Password
            </Button>
            <RouterLink to="/login">
              <Button variant="contained" color="primary" >
                Logout
              </Button>
            </RouterLink>
          </Container>


        </StyledMenu>
      </Toolbar>
    </AppBar>
  );
};

DashboardNavbar.propTypes = {
  onMobileNavOpen: PropTypes.func
};

export default DashboardNavbar;
